import React from 'react';
import { useLocation } from 'react-router-dom';
import '../../CSS/CollaborativeRoom.css'; // Import your CSS

const Collaborative = () => {
    const location = useLocation();
    const { project } = location.state || {};
    return (
        <div className="collaborative-room">
            <div className="main-content">
                <h2>Collaborative Room</h2>
                {/* Main content goes here */}
                <p>Welcome to the collaborative room!</p>
                {/* Add other content as needed */}
            </div>
            <div className="users-container">
                <h3>Users in Room</h3>
                <ul>
                    <li className="user-item">Alice</li>
                    <li className="user-item">Bob</li>
                    <li className="user-item">Charlie</li>
                    {/* Add more users as needed */}
                </ul>
            </div>
        </div>
    );
};

export default Collaborative;
